const cloneSymbol = Symbol("clone");

export default class Car {
  constructor(brand, motor, color) {
    this._brand = brand;
    this._motor = motor;
    this._color = color;
  }

  cloneCar() {
    const Constructor = this.constructor[cloneSymbol] || this.constructor;
    return new Constructor();
  }

  static [cloneSymbol] = class {
    constructor() {
      return Object.create(this.constructor.prototype);
    }
  };
}
